PaEgAjYAw\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"jTPaEgAjYAw\",\"title\":\"It's Not All Sunshine And Rainbows- Sailing SV Delos Ep. 90\",\"lengthSeconds\":\"1556\",\"keywords\":[\"sailing\",\"sailing (sport)\",\"sailing around the world\",\"إبحار\",\"cruising\",\"yacht\",\"sailboat\",\"sailboat (ship type)\",\"sailor\",\"life on a yacht\",\"Travel Documentary\",\"Travel\",\"Adventure Documentary\",\"adventure\",\"Rough Seas\",\"circumnavigate\",\"ketch\",\"sail\",\"boat\",\"blue water cruising\",\"sailing for beginners\",\"single-handed sailing (film subject)\",\"storm\",\"islands\",\"marine\",\"fishing\",\"sv delos\",\"Amel Super Maramu\",\"Seven Seas\",\"diving\",\"remote diving\",\"underwater photography\",\"delos\",\"ocean\",\"navegación\"],\"channelId\":\"UCvLc83k5o11EIF1lEo0VmuQ\",\"isOwnerViewing\":false,\"shortDescription\":\"Sometimes it's not all sunshine and rainbows out here!  We continue to explore the very cool islands of Chagos, checking out the abandoned village, exploring the countless beaches, and tracking down as many coconut crabs as we can find.  Then Max and Frida receive some bad news about family back in Sweden and are forced to change their plans.  They will need to leave a few months earlier than planned from Madagascar.  At the same time Josje is going through some very difficult decisions and decides to choose another path and head back to New Zealand to spend time with friends and family.  \\n\\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\\n\\nSubscribe!\\nhttps:\/\/youtube.com\/svdelos\\n\\nFollow Delos!\\nhttp:\/\/svdelos.com\\nhttp:\/\/instagram.com\/svdelos\\nhttp:\/\/facebook.com\/svdelos\\n\\nOur Mission\\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\\n\\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\\n\\n\\nSend Us Love\\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \\n\\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \\n\\nSupport Our Videos- Buy us a cold one.\\nhttp:\/\/www.svdelos.com\/buy-us-a-beer\\n\\nCheck the links below for more SV Delos Sailing Around The World Action!\\nwww.svdelos.com\\nwww.instagram.com\/svdelos\\nwww.facebook.com\/svdelos\\nwww.twitter.com\/svdelossailing\\n\\nThis made possible by you!  Support S\/V Delos Videos!\\nhttp:\/\/www.svdelos.com\/beer\\n\\n00:01  Ramukanji by OneTox (https:\/\/www.youtube.com\/watch?v=WNicT_k9YS0 )\\n01:14 Flying High by Phoebe Leyten (soundcloud.com\/lelijveld)\\n02:14 By the Pool by Jingle Punks  (YouTube Audio Library)\\n04.12 Killer Bee by Phoebe Leyten  (soundcloud.com\/lelijveld)\\n06:19 This Forest Was Once on Fire by Andrew Rothschild (www.andrewrothschild.bandcamp.com)\\n16:12 Eunoia by Andrew Rothschild  (www.andrewrothschild.bandcamp.com)\\n17:23 This Forest Was Once on Fire by Andrew Rothschild  (www.andrewrothsch Chagos, checking out the abandoned village, exploring the countless beaches, and tracking down as many coconut crabs as we can find.  Then Max and Frida receive some bad news about family back in Sweden and are forced to change their plans.  They will need to leave a few months earlier than planned from Madagascar.  At the same time Josje is going through some very difficult decisions and decides to choose another path and head back to New Zealand to spend time with friends and family.  \\n\\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\\n\\nSubscribe!\\nhttps:\/\/youtube.com\/svdelos\\n\\nFollow Delos!\\nhttp:\/\/svdelos.com\\nhttp:\/\/instagram.com\/svdelos\\nhttp:\/\/facebook.com\/svdelos\\n\\nOur Mission\\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\\n\\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\\n\\n\\nSend Us Love\\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \\n\\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \\n\\nSupport Our Videos- Buy us a cold one.\\nhttp:\/\/www.svdelos.com\/buy-us-a-bee l islands of Chagos, checking out the abandoned village, exploring the countless beaches, and tracking down as many coconut crabs as we can find.  Then Max and Frida receive some bad news about family back in Sweden and are forced to change their plans.  They will need to leave a few months earlier than planned from Madagascar.  At the same time Josje is going through some very difficult decisions and decides to choose another path and head back to New Zealand to spend time with friends and family.  \n\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\n\nSubscribe!\n"},{"text":"https://youtube.com/svdelos","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMImoLemeSY6gIVL-W0Ch1b_AK3SIzAjYGgwvaZjQE=","commandMetadata":{"webCommandMetadata":{"url":"https://youtube.com/svdelos","rootVe":83769}},"urlEndpoint":{"url":"https://youtube.com/svdelos","nofollow":true}}},{"text":"\n\nFollow Delos!\n"},{"text":"http://svdelos.com","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMImoLemeSY6gIVL-W0Ch1b_AK3SIzAjYGgwvaZjQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fsvdelos.com\u0026redir_token=ubURuYAdOi1kOzZiZeilpZ9Yjx98MTU5MzAzMDc2OEAxNTkyOTQ0MzY4\u0026v=jTPaEgAjYAw\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fsvdelos.com\u0026redir_token=ubURuYAdOi1kOzZiZeilpZ9Yjx98MTU5MzAzMDc2OEAxNTkyOTQ0MzY4\u0026v=jTPaEgAjYAw\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n"},{"text":"http://instagram.com/svdelos","navigationEnd  closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"jTPaEgAjYAw","title":"It's Not All Sunshine And Rainbows- Sailing SV Delos Ep. 90","lengthSeconds":"1556","keywords":["sailing","sailing (sport)","sailing around the world","إبحار","cruising","yacht","sailboat","sailboat (ship type)","sailor","life on a yacht","Travel Documentary","Travel","Adventure Documentary","adventure","Rough Seas","circumnavigate","ketch","sail","boat","blue water cruising","sailing for beginners","single-handed sailing (film subject)","storm","islands","marine","fishing","sv delos","Amel Super Maramu","Seven Seas","diving","remote diving","underwater photography","delos","ocean","navegación"],"channelId":"UCvLc83k5o11EIF1lEo0VmuQ","isOwnerViewing":false,"shortDescription":"Sometimes it's not all sunshine and rainbows out here!  We continue to explore the very cool islands of Chagos, checking out the abandoned village, exploring the countless beaches, and tracking down as many coconut crabs as we can find.  Then Max and Frida receive some bad news about family back in Sweden and are forced to change their plans.  They will need to leave a few months earlier than planned from Madagascar.  At the same time Josje is going through some very difficult decisions and decides to choose another path and head back to New Zealand to spend time with friends and family.  \n\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\n\nSubscribe!\nhttps://youtube.com/svdelos\n\nFollow Delos!\nhttp://svdelos.com\nhttp://instagram.com/svdelos\nhttp://facebook.com/svdelos\n\nOur Mission\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\n\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\n\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\nhttp://www.svdelos.com/buy-us-a-beer\n\nCheck the links below for more SV Delos Sailing Around The World Action!\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\nwww.twitter.com/svdelossailing\n\nThis made possible by you!  Support S/V Delos Videos!\nhttp://www.svdelos.com/beer\n\n00:01  Ramukanji by OneTox (https://www.youtube.com/watch?v=WNicT_k9YS0 )\n01:14 Flying High by Phoebe Leyten (soundcloud.com/lelijveld)\n02:14 By the Pool by Jingle Punks  (YouTube Audio Library)\n04.12 Killer Bee by Phoebe Leyten  (soundcloud.com/lelijveld)\n06:19 This Forest Was Once on Fire by Andrew Rothschild (www.andrewrothschild.bandcamp.com)\n16:12 Eunoia by Andrew Rothschild  (www.andrewrothschild.bandcamp.com)\n17:23 This Forest Was Once on Fire by Andrew Rothschild  (www.andrewrothschild.bandcamp.com)\n19:37 Sol by Andrew Rothschild  (www.andrewrothschild.bandcamp.com)\n20:59 Killer Bee by Phoebe Leyten  (soundcloud.com/lelijveld)","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/jTPaEgAjYAw/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLApErexsyWidFqyZ9fU2uAPhEjH7g","width":168,"height":94 er path and head back to New Zealand to spend time with friends and family.  \n\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\n\nSubscribe!\nhttps://youtube.com/svdelos\n\nFollow Delos!\nhttp://svdelos.com\nhttp://instagram.com/svdelos\nhttp://facebook.com/svdelos\n\nOur Mission\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\n\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\n\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\nhttp://www.svdelos.com/buy-us-a-beer\n\nCheck the links below for more SV Delos Sailing Around The World Action!\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\nwww.twitter.com/svdelossailing\n\nThis made possible by you!  Support S/V Delos Videos!\nhttp://www.svdelos.com/beer\n\n00:01  Ramukanji by OneTox (https://www.youtube.com/watch?v=WNicT_k9YS0 )\n01:14 Flying High by Phoebe Leyten (soundcloud.com/lelijveld)\n02:14 By the Pool by Jingle Punks  (YouTube Au
